import React, { Component } from "react";
import "../styles/Main.css";
import logo from "../styles/img/logo_test.png";

class Main extends Component{
    render() {
        return (<div class="main-page">
            <div class="top-panel">
                <a class="main-page-redirect" href="/">
                    <img class="main-page-redirect-image" src={logo} alt=":("/>
                </a>

                <div class="search-panel">
                    <form action="/search/" autocomplete="off" class="form-search" method="get" role="search">
                        <input type="search" class="search" placeholder="Поиск" />
                    </form>
                </div>

                <div class="login">
                    <a class="login-redirect" href="/login"><strong>"Войти"</strong></a> 
                </div>
                <div class="register">
                    <a class="register-redirect" href="/register"><strong>"Зарегистрироваться"</strong></a>
                </div>
            </div>
        </div>);
    }
}

export default Main;
